export const insertCandidate = data => {
    const CandidateList = getAllCandidate();
    CandidateList.push({...data, id: CandidateList.length + 1});
    localStorage.setItem("CandidateList", JSON.stringify(CandidateList))
}

export const getAllCandidate = () => {
    if(localStorage.getItem("CandidateList") == null) {
        localStorage.setItem("CandidateList", JSON.stringify(initialCandidateList));
    } 
    let CandidateList = JSON.parse(localStorage.getItem("CandidateList"));
    return CandidateList;
}